import React, { Component } from 'react';
import LineChart from 'react-linechart';
import './Linestyle.css';

export default class Linechart extends Component {
    render() {
        const data = [
            {									
                color: "steelblue", 
                points: props.points
            }
        ];
        return (
            <div>
                <div className="App">
                    <LineChart 
                        width={200}
                        height={150}
                        data={data}
                    />
                </div>				
            </div>
        );
    }
}
